import '../node_modules/bootstrap/dist/css/bootstrap.min.css'
import Home from './components/home';

function App() {
  return (
    <>
    <Router>
      <Routes>
        <Route path="/" element={<Login/>}/>
        <Route path='/dashboard' element={<Dashboard/>}/>
      </Routes>
    </Router>
    <Home/>
    </>
  );
}

export default App;
